svg.script:
var data = {
	"sp": 10,
	"coins": 10,
	"theonite": 10,
	"fsboost": 10
};
function postMessage() {
	var json = JSON.stringify(data);
	window.parent.postMessage(json, window.parent.origin);
}
function updateTree(e) {
	if (e.target.tagName.toLowerCase() == "polygon") {
		postMessage();
	}
}
window.addEventListener("click", updateTree);
